@profile
def solution(width: int, length: int, plants: List[Tuple[int, int]], dump_cache: bool = False) -> int:
    # 1 -> upper part of vertical; 0 -> other (horizontal or lower part of vertical)
    is_valid: List[bool] = []
    for state in range(1 << width):
        # state is valid if all consecutive segments of 0 are of even length
        ok = True
        i = 0
        while i < width:
            if (state >> i & 1) == 1:
                i += 1
                continue
            j = next((idx for idx in range(i + 1, width) if (state >> idx & 1) == 1), width)
            if (j - i) % 2 == 1:
                ok = False
                break
            i = j
        is_valid.append(ok)
    # for state in range(1 << width):
    #     if is_valid[state]:
    #         print(bin(state))

    rows = defaultdict(list)
    for x, y in plants:
        rows[y].append(x)
    blocked: List[Tuple[int, int]] = [  # [(row_id, blocked_cols_state)]
        (row, sum(1 << x for x in cols)) for row, cols in rows.items()]
    blocked.sort()
    if len(blocked) == 0 or blocked[-1][0] != length - 1:
        blocked.append((length - 1, 0))

    all_powers = [0] + [row for row, _ in blocked] + [length]
    max_power = max(b - a for a, b in zip(all_powers, all_powers[1:])) + 1
    max_power_of_two = len(bin(max_power)) - 2
    if width in MATPOWER and not dump_cache:
        mat_powers = [None] * (max_power_of_two + 1)
        # mat_powers = [CSCMatrix.load(data) for data in MATPOWER[width][:(max_power_of_two + 1)]]
        all_block_trans_states = load(ALL_BLOCK_TRANS_STATES[width])
    else:
        transition = Matrix(1 << width, 1 << width)
        for state in range(1 << width):
            for next_state in range(1 << width):
                # 1. There can't be consecutive 1s in a column; 1 must be followed by a 0.
                # 2. Horizontal blocks in next row are: ~(state | next_state).
                if (state & next_state == 0) and is_valid[state | next_state]:
                    transition[state, next_state] = 1
        # print(transition)
        mat_powers = [transition]
        for _ in range(max_power_of_two):
            mat_powers.append(mat_powers[-1] * mat_powers[-1])
        mat_powers = [CSCMatrix(mat) for mat in mat_powers]

        valid_states: List[List[int]] = [
            [state for state in range(1 << width) if next_state & state == 0]
            for next_state in range(1 << width)]

        all_block_trans_states = []
        for blocked_state in range(1 << width):
            block_trans_states = []
            for next_state in range(1 << width):
                trans_states = []
                for state in valid_states[next_state]:
                    if ((state | next_state) & blocked_state == 0) and is_valid[state | next_state | blocked_state]:
                        trans_states.append(state)
                block_trans_states.append(trans_states)
            all_block_trans_states.append(block_trans_states)

        if dump_cache:
            for mat in mat_powers:
                print(mat.dump())
            print(dump(all_block_trans_states))
            # print(sum(len(mat.dump()) for mat in mat_powers))
    transition = mat_powers[0]

    @profile
    def mvpow(a: Vector, b: int) -> Vector:
        for i, mat in enumerate(mat_powers):
            if mat is None:
                mat_powers[i] = mat = CSCMatrix.load(MATPOWER[width][i])
            if b & 1: a = mat.__rmul__(a)
            b >>= 1
            if b == 0: break
        return a

    cur_val = Vector(1 << width)
    cur_val[0] = 1
    cur_row = -1
    for row, blocked_state in blocked:
        cur_val = mvpow(cur_val, row - 1 - cur_row)
        cur_row = row
        prev_arr = cur_val.arr
        cur_val.arr = [
            sum(prev_arr[s] for s in trans_states) % MOD
            for trans_states in all_block_trans_states[blocked_state]]
